      new_state: execute
    ip nat inside source static 35.0.0.1 135.0.0.1 route-map rm_1 no-alias: "ip nat\
      \ inside source static 35.0.0.1 135.0.0.1 route-map rm\b\b\b\b\b\b\b\b\b\b\b\
      \b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\
      \b\b\b\b\b\b\b\b\b\b$de source static 35.0.0.1 135.0.0.1 route-map rm_     \
      \    \b\b\b\b\b\b\b\b\b1 no-alia\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\
      \b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\bstatic\
      \ 35.0.0.1 135.0.0.1 route-map rm_1 no-alias         \b\b\b\b\b\b\b\b\b\r\n"
